    "All learners in the {cohort_name} cohort": "\u05db\u05dc \u05d4\u05dc\u05d5\u05de\u05d3\u05d9\u05dd \u05d1\u05e7\u05d1\u05d5\u05e6\u05ea \u05d4\u05dc\u05d9\u05de\u05d5\u05d3 {cohort_name}",
