    "All users on the Exception list who do not yet have a certificate": "\u05db\u05dc \u05d4\u05de\u05e9\u05ea\u05de\u05e9\u05d9\u05dd \u05d1\u05e8\u05e9\u05d9\u05de\u05ea \u05d4\u05d7\u05e8\u05d9\u05d2\u05d9\u05dd \u05e9\u05dc\u05d0 \u05e7\u05d9\u05d1\u05dc\u05d5 \u05e2\u05d3\u05d9\u05d9\u05df \u05ea\u05e2\u05d5\u05d3\u05d4",
    "Allow others to copy, distribute, display and perform only verbatim copies of your work, not derivative works based upon it. This option is incompatible with \"Share Alike\".": "Cho ph\u00e9p ng\u01b0\u1eddi kh\u00e1c sao ch\u00e9p, ph\u00e2n ph\u1ed1i, hi\u1ec3n th\u1ecb v\u00e0 tr\u00ecnh di\u1ec5n ch\u1ec9 c\u00e1c b\u1ea3n sao nguy\u00ean b\u1ea3n c\u1ee7a t\u00e1c ph\u1ea9m c\u1ee7a b\u1ea1n ch\u1ee9 kh\u00f4ng ph\u1ea3i c\u00e1c t\u00e1c ph\u1ea9m ph\u00e1i sinh d\u1ef1a tr\u00ean n\u00f3. T\u00f9y ch\u1ecdn n\u00e0y kh\u00f4ng t\u01b0\u01a1ng th\u00edch v\u1edbi \"Chia s\u1ebb t\u01b0\u01a1ng t\u1ef1\".",
    "Allow others to copy, distribute, display and perform your copyrighted work but only if they give credit the way you request. Currently, this option is required.": "Cho ph\u00e9p ng\u01b0\u1eddi kh\u00e1c sao ch\u00e9p, ph\u00e2n ph\u1ed1i, tr\u01b0ng b\u00e0y v\u00e0 tr\u00ecnh di\u1ec5n t\u00e1c ph\u1ea9m c\u00f3 b\u1ea3n quy\u1ec1n c\u1ee7a b\u1ea1n nh\u01b0ng ch\u1ec9 khi h\u1ecd cung c\u1ea5p t\u00edn d\u1ee5ng theo c\u00e1ch b\u1ea1n y\u00eau c\u1ea7u. Hi\u1ec7n t\u1ea1i, t\u00f9y ch\u1ecdn n\u00e0y l\u00e0 b\u1eaft bu\u1ed9c.",
    "Allow others to copy, distribute, display and perform your work - and derivative works based upon it - but for noncommercial purposes only.": "Cho ph\u00e9p ng\u01b0\u1eddi kh\u00e1c sao ch\u00e9p, ph\u00e2n ph\u1ed1i, tr\u01b0ng b\u00e0y v\u00e0 tr\u00ecnh di\u1ec5n t\u00e1c ph\u1ea9m c\u1ee7a b\u1ea1n - v\u00e0 c\u00e1c t\u00e1c ph\u1ea9m ph\u00e1i sinh d\u1ef1a tr\u00ean n\u00f3 - nh\u01b0ng ch\u1ec9 cho c\u00e1c m\u1ee5c \u0111\u00edch phi th\u01b0\u01a1ng m\u1ea1i.",
    "Allow others to distribute derivative works only under a license identical to the license that governs your work. This option is incompatible with \"No Derivatives\".": "Cho ph\u00e9p ng\u01b0\u1eddi kh\u00e1c ph\u00e2n ph\u1ed1i c\u00e1c t\u00e1c ph\u1ea9m ph\u00e1i sinh ch\u1ec9 theo m\u1ed9t gi\u1ea5y ph\u00e9p gi\u1ed1ng v\u1edbi gi\u1ea5y ph\u00e9p chi ph\u1ed1i c\u00f4ng vi\u1ec7c c\u1ee7a b\u1ea1n. T\u00f9y ch\u1ecdn n\u00e0y kh\u00f4ng t\u01b0\u01a1ng th\u00edch v\u1edbi \"Kh\u00f4ng Ph\u00e1i sinh\".",
    "Allow students to generate certificates for this course?": "\u05dc\u05d0\u05e4\u05e9\u05e8 \u05dc\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8\u05d9\u05dd \u05dc\u05d9\u05e6\u05d5\u05e8 \u05ea\u05e2\u05d5\u05d3\u05d5\u05ea \u05e2\u05d1\u05d5\u05e8 \u05e7\u05d5\u05e8\u05e1 \u05d6\u05d4?",
    "Already a course team member": "\u05db\u05d1\u05e8 \u05d7\u05d1\u05e8 \u05d1\u05e6\u05d5\u05d5\u05ea \u05d4\u05e7\u05d5\u05e8\u05e1",
