    "Any course progress or grades from your current session will be lost.": "B\u1ea5t k\u1ef3 ti\u1ebfn tr\u00ecnh kh\u00f3a h\u1ecdc ho\u1eb7c \u0111i\u1ec3m t\u1eeb phi\u00ean hi\u1ec7n t\u1ea1i c\u1ee7a b\u1ea1n s\u1ebd b\u1ecb m\u1ea5t.",
    "Any divided discussion topics are divided based on cohort.": "Ch\u1ee7 \u0111\u1ec1 th\u1ea3o lu\u1eadn \u0111\u01b0\u1ee3c ph\u00e2n chia d\u1ef1a tr\u00ean theo nh\u00f3m.",
    "Any divided discussion topics are divided based on enrollment track.": "Ch\u1ee7 \u0111\u1ec1 th\u1ea3o lu\u1eadn \u0111\u01b0\u1ee3c ph\u00e2n chia d\u1ef1a tr\u00ean ki\u1ec3u \u0111\u0103ng k\u00fd.",
