    "Thank you for setting your course goal to {goal}!": "C\u1ea3m \u01a1n b\u1ea1n \u0111\u00e3 \u0111\u1eb7t m\u1ee5c ti\u00eau kh\u00f3a h\u1ecdc c\u1ee7a b\u1ea1n th\u00e0nh {goal}!",
    "Thank you for submitting your financial assistance application for {course_name}! You can expect a response in 2-4 business days.": "\u05ea\u05d5\u05d3\u05d4 \u05e9\u05e9\u05dc\u05d7\u05ea \u05d0\u05ea \u05d0\u05e4\u05dc\u05d9\u05e7\u05e6\u05d9\u05d9\u05ea \u05d4\u05e1\u05d9\u05d5\u05e2 \u05d4\u05db\u05e1\u05e4\u05d9 \u05e9\u05dc\u05da \u05dc-{course_name}! \u05ea\u05d5\u05db\u05dc \u05dc\u05e6\u05e4\u05d5\u05ea \u05dc\u05ea\u05e9\u05d5\u05d1\u05d4 \u05ea\u05d5\u05da 4-2 \u05d9\u05de\u05d9 \u05e2\u05e1\u05e7\u05d9\u05dd.",
    "Thank you for submitting your photos. We will review them shortly. You can now sign up for any %(platformName)s course that offers verified certificates. Verification is good for one year. After one year, you must submit photos for verification again.": "\u05ea\u05d5\u05d3\u05d4 \u05e2\u05dc \u05d4\u05d2\u05e9\u05ea \u05ea\u05de\u05d5\u05e0\u05d5\u05ea\u05d9\u05da. \u05d0\u05e0\u05d5 \u05e0\u05d1\u05d3\u05d5\u05e7 \u05d0\u05d5\u05ea\u05df \u05d1\u05e7\u05e8\u05d5\u05d1. \u05d9\u05e9 \u05d1\u05d0\u05e4\u05e9\u05e8\u05d5\u05ea\u05da \u05db\u05e2\u05ea \u05dc\u05d4\u05d9\u05e8\u05e9\u05dd \u05dc\u05db\u05dc \u05e7\u05d5\u05e8\u05e1\u05d9 %(platformName)s \u05e9\u05de\u05e6\u05d9\u05e2\u05d9\u05dd \u05ea\u05e2\u05d5\u05d3\u05d4 \u05e2\u05dd \u05d6\u05d4\u05d5\u05ea \u05de\u05d0\u05d5\u05de\u05ea\u05ea. \u05d0\u05d9\u05de\u05d5\u05ea \u05d6\u05d4\u05d5\u05ea\u05da \u05ea\u05e7\u05e3 \u05dc\u05e9\u05e0\u05d4 \u05d0\u05d7\u05ea. \u05dc\u05d0\u05d7\u05e8 \u05e9\u05e0\u05d4, \u05e2\u05dc\u05d9\u05da \u05dc\u05d4\u05d2\u05d9\u05e9 \u05ea\u05de\u05d5\u05e0\u05d5\u05ea \u05dc\u05d0\u05d9\u05de\u05d5\u05ea \u05d7\u05d5\u05d6\u05e8.",
    "Thank you! We have received your payment for {courseName}.": "\u05ea\u05d5\u05d3\u05d4 \u05e8\u05d1\u05d4! \u05e7\u05d9\u05d1\u05dc\u05e0\u05d5 \u05d0\u05ea \u05ea\u05e9\u05dc\u05d5\u05de\u05da \u05e2\u05d1\u05d5\u05e8 {courseName}.",
    "Thanks for returning to verify your ID in: {courseName}": "\u05ea\u05d5\u05d3\u05d4 \u05e9\u05d7\u05d6\u05e8\u05ea \u05dc\u05d5\u05d5\u05d3\u05d0 \u05d0\u05ea \u05d4\u05ea\u05e2\u05d5\u05d3\u05d4 \u05d4\u05de\u05d6\u05d4\u05d4 \u05e9\u05dc\u05da: {courseName}",
    "The URL you entered seems to be an email address. Do you want to add the required mailto: prefix?": "URL b\u1ea1n \u0111\u00e3 nh\u1eadp v\u00e0o d\u01b0\u1eddng nh\u01b0 l\u00e0 m\u1ed9t \u0111\u1ecba ch\u1ec9 email. B\u1ea1n c\u00f3 mu\u1ed1n th\u00eam li\u00ean k\u1ebft mailto:?",
    "The URL you entered seems to be an external link. Do you want to add the required http:// prefix?": "URL b\u1ea1n \u0111\u00e3 nh\u1eadp v\u00e0o d\u01b0\u1eddng nh\u01b0 l\u00e0 m\u1ed9t li\u00ean k\u1ebft ngo\u00e0i. B\u1ea1n c\u00f3 mu\u1ed1n th\u00eam v\u00e0o ti\u1ec1n t\u1ed1 c\u1ea7n thi\u1ebft http:// ?",
    "The assignment type must have a name.": "Lo\u1ea1i ph\u00e2n c\u00f4ng ph\u1ea3i c\u00f3 t\u00ean.",
    "The certificate available date must be later than the course end date.": "Ng\u00e0y c\u1ea5p ch\u1ee9ng ch\u1ec9 ph\u1ea3i sau ng\u00e0y k\u1ebft th\u00fac kh\u00f3a h\u1ecdc.",
    "The certificate for this learner has been re-validated and the system is re-running the grade for this learner.": "\u05d4\u05ea\u05e2\u05d5\u05d3\u05d4 \u05e9\u05dc \u05ea\u05dc\u05de\u05d9\u05d3 \u05d6\u05d4 \u05d0\u05d5\u05de\u05ea\u05d4 \u05de\u05d7\u05d3\u05e9 \u05d5\u05d4\u05de\u05e2\u05e8\u05db\u05ea \u05de\u05e8\u05d9\u05e6\u05d4 \u05de\u05d7\u05d3\u05e9 \u05d0\u05ea \u05d4\u05e6\u05d9\u05d5\u05df \u05e2\u05d1\u05d5\u05e8 \u05ea\u05dc\u05de\u05d9\u05d3 \u05d6\u05d4.",
    "The cohort cannot be added": "\u05dc\u05d0 \u05e0\u05d9\u05ea\u05df \u05dc\u05d4\u05d5\u05e1\u05d9\u05e3 \u05d0\u05ea \u05e7\u05d1\u05d5\u05e6\u05ea \u05d4\u05dc\u05d9\u05de\u05d5\u05d3",
