    "The following file types are not allowed: ": "\u05e1\u05d5\u05d2\u05d9 \u05d4\u05e7\u05d1\u05e6\u05d9\u05dd \u05d4\u05d1\u05d0\u05d9\u05dd \u05d0\u05d9\u05e0\u05dd \u05de\u05d5\u05e8\u05e9\u05d9\u05dd: ",
