    "Time Allotted (HH:MM):": "\u05d6\u05de\u05df \u05e9\u05d4\u05d5\u05e7\u05e6\u05d1 (\u05e9\u05e9:\u05d3\u05d3):",
    "Time Sent": "\u05d6\u05de\u05df \u05d4\u05e9\u05dc\u05d9\u05d7\u05d4:",
    "Time Sent:": "\u05d6\u05de\u05df \u05d4\u05e9\u05dc\u05d9\u05d7\u05d4:",
    "Time Zone": "\u05d0\u05d6\u05d5\u05e8 \u05d6\u05de\u05df",
    "Timed": "\u05de\u05ea\u05d5\u05d6\u05de\u05df",
    "Timed Exam": "\u05de\u05d1\u05d7\u05df \u05de\u05ea\u05d5\u05d6\u05de\u05df",
    "Timed Out": "\u05ea\u05d5\u05d6\u05de\u05df",
    "Timed Transcript Conflict": "\u05e2\u05d9\u05de\u05d5\u05ea \u05ea\u05de\u05dc\u05d9\u05dc \u05de\u05ea\u05d5\u05d6\u05de\u05df",
    "Timed Transcript Found": "\u05e0\u05de\u05e6\u05d0 \u05ea\u05de\u05dc\u05d9\u05dc \u05de\u05ea\u05d5\u05d6\u05de\u05df",
    "Timed Transcript Uploaded Successfully": "\u05ea\u05de\u05dc\u05d9\u05dc \u05de\u05ea\u05d5\u05d6\u05de\u05df \u05d4\u05d5\u05e2\u05dc\u05d4 \u05d1\u05d4\u05e6\u05dc\u05d7\u05d4",
    "Timed Transcript from %(filename)s": "\u05ea\u05de\u05dc\u05d9\u05dc \u05de\u05ea\u05d5\u05d6\u05de\u05df \u05de%(filename)s",
    "Tips on taking a successful photo": "\u05d8\u05d9\u05e4\u05d9\u05dd \u05dc\u05e6\u05d9\u05dc\u05d5\u05dd \u05ea\u05de\u05d5\u05e0\u05d4 \u05d8\u05d5\u05d1\u05d4",
    "Title": "\u05db\u05d5\u05ea\u05e8\u05ea",
    "Title ": "\u05db\u05d5\u05ea\u05e8\u05ea ",
    "Title of the signatory": "\u05db\u05d5\u05ea\u05e8\u05ea \u05d4\u05d7\u05d5\u05ea\u05dd",
    "Titles more than 100 characters may prevent students from printing their certificate on a single page.": "\u05db\u05d5\u05ea\u05e8\u05d5\u05ea \u05d1\u05e2\u05dc\u05ea \u05d9\u05d5\u05ea\u05e8 \u05de-100 \u05ea\u05d5\u05d5\u05d9\u05dd \u05e2\u05e9\u05d5\u05d9\u05d5\u05ea \u05dc\u05de\u05e0\u05d5\u05e2 \u05de\u05d4\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8\u05d9\u05dd \u05dc\u05d4\u05d3\u05e4\u05d9\u05e1 \u05d0\u05ea \u05ea\u05e2\u05d5\u05d3\u05ea\u05dd \u05d1\u05e2\u05de\u05d5\u05d3 \u05d0\u05d7\u05d3.",
    "To be sure all students can access the video, we recommend providing both an .mp4 and a .webm version of your video. Click below to add a URL for another version. These URLs cannot be YouTube URLs. The first listed video that's compatible with the student's computer will play.": "\u05e2\u05dc \u05de\u05e0\u05ea \u05dc\u05d5\u05d5\u05d3\u05d0 \u05e9\u05db\u05dc \u05d4\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8\u05d9\u05dd \u05d9\u05d5\u05db\u05dc\u05d5 \u05dc\u05d2\u05e9\u05ea \u05dc\u05e1\u05e8\u05d8\u05d5\u05df \u05d4\u05d5\u05d5\u05d9\u05d3\u05d0\u05d5, \u05d0\u05e0\u05d5 \u05de\u05de\u05dc\u05d9\u05e6\u05d9\u05dd \u05e9\u05ea\u05e1\u05e4\u05e7 \u05dc\u05e1\u05e8\u05d8\u05d5\u05df \u05d2\u05e8\u05e1\u05d0\u05d5\u05ea \u05d1\u05e7\u05d5\u05d1\u05e5 MP4 \u05d5\u05d1\u05e7\u05d5\u05d1\u05e5 WEBM. \u05dc\u05d7\u05e5 \u05dc\u05de\u05d8\u05d4 \u05dc\u05d4\u05d5\u05e1\u05d9\u05e3 \u05db\u05ea\u05d5\u05d1\u05ea URL \u05e2\u05d1\u05d5\u05e8 \u05d2\u05e8\u05e1\u05d4 \u05e0\u05d5\u05e1\u05e4\u05ea. \u05db\u05ea\u05d5\u05d1\u05d5\u05ea \u05d4-URL \u05d4\u05dc\u05dc\u05d5 \u05d0\u05d9\u05e0\u05df \u05d9\u05db\u05d5\u05dc\u05d5\u05ea \u05dc\u05d4\u05d9\u05d5\u05ea \u05db\u05ea\u05d5\u05d1\u05d5\u05ea URL \u05e9\u05dc \u05d9\u05d5\u05d8\u05d9\u05d5\u05d1. \u05d4\u05e1\u05e8\u05d8\u05d5\u05df \u05d4\u05e8\u05d0\u05e9\u05d5\u05df \u05e9\u05d9\u05ea\u05d0\u05d9\u05dd \u05dc\u05d4\u05e6\u05d2\u05d4 \u05d1\u05de\u05d7\u05e9\u05d1\u05d5 \u05e9\u05dc \u05d4\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8, \u05d4\u05d5\u05d0 \u05d6\u05d4 \u05e9\u05d9\u05d5\u05e6\u05d2. ",
    "To finalize course credit, %(display_name)s requires %(platform_name)s learners to submit a credit request.": "\u05db\u05d3\u05d9 \u05dc\u05d4\u05e9\u05dc\u05d9\u05dd \u05d0\u05ea \u05e7\u05d1\u05dc\u05ea \u05e0\u05e7\u05d5\u05d3\u05d5\u05ea \u05d4\u05d6\u05db\u05d5\u05ea \u05e9\u05dc \u05d4\u05e7\u05d5\u05e8\u05e1, %(display_name)s \u05d3\u05d5\u05e8\u05e9 \u05de\u05d4\u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd \u05e9\u05dc %(platform_name)s, \u05d9\u05e9 \u05dc\u05e9\u05dc\u05d5\u05d7 \u05d1\u05e7\u05e9\u05d4 \u05dc\u05e7\u05d1\u05dc\u05ea \u05e0\u05e7\u05d5\u05d3\u05d5\u05ea \u05d6\u05db\u05d5\u05ea.",
    "To invalidate a certificate for a particular learner, add the username or email address below.": "\u05e2\u05dc  \u05de\u05e0\u05ea \u05dc\u05e4\u05e1\u05d5\u05dc \u05ea\u05e2\u05d5\u05d3\u05d4 \u05dc\u05dc\u05d5\u05de\u05d3 \u05de\u05e1\u05d5\u05d9\u05dd, \u05d4\u05d5\u05e1\u05e3 \u05d1\u05d4\u05de\u05e9\u05da \u05d0\u05ea \u05e9\u05dd \u05d4\u05de\u05e9\u05ea\u05de\u05e9 \u05d0\u05d5 \u05db\u05ea\u05d5\u05d1\u05ea \u05d4\u05d3\u05d5\u05d0\u05e8 \u05d4\u05d0\u05dc\u05e7\u05d8\u05e8\u05d5\u05e0\u05d9.",
    "To pass this exam, you must complete the problems in the time allowed.": "\u05e2\u05dc \u05de\u05e0\u05ea \u05dc\u05e2\u05d1\u05d5\u05e8 \u05de\u05d1\u05d7\u05df \u05d6\u05d4, \u05e2\u05dc\u05d9\u05da \u05dc\u05d4\u05e9\u05dc\u05d9\u05dd \u05d0\u05ea \u05d4\u05d1\u05e2\u05d9\u05d5\u05ea \u05d1\u05d6\u05de\u05df \u05d4\u05de\u05d5\u05e7\u05e6\u05d1.",
    "To receive a certificate, you must also verify your identity before {date}.": "\u05dc\u05e4\u05e0\u05d9 \u05e7\u05d1\u05dc\u05ea \u05d4\u05ea\u05e2\u05d5\u05d3\u05d4, \u05e2\u05dc\u05d9\u05da \u05dc\u05d0\u05de\u05ea \u05d0\u05ea \u05d6\u05d4\u05d5\u05ea\u05da {date}. ",
    "To receive a certificate, you must also verify your identity.": "\u05db\u05d3\u05d9 \u05dc\u05e7\u05d1\u05dc \u05ea\u05e2\u05d5\u05d3\u05d4, \u05e2\u05dc\u05d9\u05da \u05dc\u05d0\u05de\u05ea \u05d2\u05dd \u05d0\u05ea \u05d6\u05d4\u05d5\u05ea\u05da.",
    "To receive credit for problems, you must select \"Submit\" for each problem before you select \"End My Exam\".": "\u05db\u05d3\u05d9 \u05dc\u05e7\u05d1\u05dc \u05e0\u05e7\u05d5\u05d3\u05ea \u05d6\u05db\u05d5\u05ea \u05e2\u05dc \u05d1\u05e2\u05d9\u05d5\u05ea, \u05e2\u05dc\u05d9\u05da \u05dc\u05d1\u05d7\u05d5\u05e8 \"\u05d4\u05d2\u05e9\"' \u05e2\u05d1\u05d5\u05e8 \u05db\u05dc \u05d1\u05e2\u05d9\u05d4 \u05dc\u05e4\u05e0\u05d9 \u05e9\u05ea\u05d1\u05d7\u05e8 \u05d1\"\u05e1\u05d9\u05d5\u05dd \u05d4\u05de\u05d1\u05d7\u05df \u05e9\u05dc\u05d9\".",
    "To share your certificate on Mozilla Backpack, you must first have a Backpack account. Complete the following steps to add your certificate to Backpack.": "\u05db\u05d3\u05d9 \u05dc\u05e9\u05ea\u05e3 \u05d0\u05ea \u05ea\u05e2\u05d5\u05d3\u05ea\u05da \u05d1-Mozilla Backpack, \u05e2\u05dc\u05d9\u05da \u05dc\u05e4\u05ea\u05d5\u05d7 \u05d7\u05e9\u05d1\u05d5\u05df Backpack \u05ea\u05d7\u05d9\u05dc\u05d4. \u05d4\u05e9\u05dc\u05dd \u05d0\u05ea \u05d4\u05e9\u05dc\u05d1\u05d9\u05dd \u05d4\u05d1\u05d0\u05d9\u05dd \u05db\u05d3\u05d9 \u05dc\u05d4\u05d5\u05e1\u05d9\u05e3 \u05d0\u05ea \u05ea\u05e2\u05d5\u05d3\u05ea\u05da \u05dc-Backpack.",
    "To take a successful photo, make sure that:": "\u05e2\u05dc \u05de\u05e0\u05ea \u05dc\u05e6\u05dc\u05dd \u05ea\u05de\u05d5\u05e0\u05d4 \u05de\u05d5\u05e6\u05dc\u05d7\u05ea, \u05d5\u05d3\u05d0 \u05db\u05d9:",
    "To use the current photo, select the camera button {icon}. To take another photo, select the retake button {icon}.": "\u05e2\u05dc \u05de\u05e0\u05ea \u05dc\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05ea\u05de\u05d5\u05e0\u05d4 \u05d4\u05e2\u05d3\u05db\u05e0\u05d9\u05ea, \u05d1\u05d7\u05e8 \u05d1\u05dc\u05d7\u05e6\u05df \u05d4\u05de\u05e6\u05dc\u05de\u05d4 {icon}. \u05db\u05d3\u05d9 \u05dc\u05e6\u05dc\u05dd \u05ea\u05de\u05d5\u05e0\u05d4 \u05d0\u05d7\u05e8\u05ea, \u05d1\u05d7\u05e8 \u05d1\u05dc\u05d7\u05e6\u05df \u05d4\u05e6\u05d9\u05dc\u05d5\u05dd \u05de\u05d7\u05d3\u05e9 {icon}.",
    "To verify your identity, you need a webcam and a government-issued photo ID.": "\u05e2\u05dc \u05de\u05e0\u05ea \u05dc\u05d0\u05de\u05ea \u05d0\u05ea \u05d6\u05d4\u05d5\u05ea\u05da, \u05ea\u05d6\u05d3\u05e7\u05e7 \u05dc\u05de\u05e6\u05dc\u05de\u05ea \u05e8\u05e9\u05ea \u05d5\u05dc\u05ea\u05e2\u05d5\u05d3\u05d4 \u05de\u05d6\u05d4\u05d4.",
    "Today": "\u05d4\u05d9\u05d5\u05dd",
