    "Transcripts": "B\u1ea3n d\u1ecbch",
    "Try the transaction again in a few minutes.": "\u05e0\u05e1\u05d4 \u05dc\u05d1\u05e6\u05e2 \u05d0\u05ea \u05d4\u05d4\u05e2\u05d1\u05e8\u05d4 \u05e9\u05d5\u05d1 \u05d1\u05e2\u05d5\u05d3 \u05de\u05e1\u05e4\u05e8 \u05d3\u05e7\u05d5\u05ea.",
    "Try using a different browser, such as Google Chrome.": "Th\u1eed s\u1eed d\u1ee5ng m\u1ed9t tr\u00ecnh duy\u1ec7t kh\u00e1c, nh\u01b0 Google Chrome.",
