    "Use a timed exam to limit the time learners can spend on problems in this subsection. Learners must submit answers before the time expires. You can allow additional time for individual learners through the Instructor Dashboard.": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05de\u05d1\u05d7\u05df \u05de\u05ea\u05d5\u05d6\u05de\u05df \u05e2\u05dc \u05de\u05e0\u05ea \u05dc\u05d4\u05d2\u05d1\u05d9\u05dc \u05d0\u05ea \u05d6\u05de\u05df \u05d4\u05d4\u05e9\u05e7\u05e2\u05d4 \u05e9\u05dc \u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd \u05d1\u05d1\u05e2\u05d9\u05d5\u05ea \u05d1\u05ea\u05ea-\u05e4\u05e8\u05e7 \u05d6\u05d4. \u05d4\u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd \u05d7\u05d9\u05d9\u05d1\u05d9\u05dd \u05dc\u05d4\u05d2\u05d9\u05e9 \u05ea\u05e9\u05d5\u05d1\u05d5\u05ea \u05dc\u05e4\u05e0\u05d9 \u05e9\u05ea\u05dd \u05d4\u05d6\u05de\u05df . \u05ea\u05d5\u05db\u05dc \u05dc\u05d0\u05e4\u05e9\u05e8 \u05d6\u05de\u05df \u05e0\u05d5\u05e1\u05e3 \u05dc\u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd \u05d0\u05d9\u05e0\u05d3\u05d9\u05d1\u05d9\u05d3\u05d5\u05d0\u05dc\u05d9\u05d9\u05dd \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05dc\u05d5\u05d7 \u05d4\u05d1\u05e7\u05e8\u05d4 \u05e9\u05dc \u05d4\u05de\u05d3\u05e8\u05d9\u05da.",
    "Use as a Prerequisite": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05db\u05d3\u05e8\u05d9\u05e9\u05d4 \u05de\u05d5\u05e7\u05d3\u05de\u05ea",
    "Use cohorts as the basis for dividing discussions. All learners, regardless of cohort, see the same discussion topics, but within divided topics, only members of the same cohort see and respond to each others\u2019 posts. ": "\u05d4\u05e9\u05ea\u05de\u05e9\u05d5 \u05d1'\u05e7\u05d1\u05d5\u05e6\u05d5\u05ea \u05dc\u05de\u05d9\u05d3\u05d4' \u05e9\u05d4\u05d2\u05d3\u05e8\u05ea\u05dd \u05e2\u05d1\u05d5\u05e8 \u05d7\u05dc\u05d5\u05e7\u05ea \u05d4\u05d3\u05d9\u05d5\u05e0\u05d9\u05dd. \u05e9\u05d9\u05de\u05d5 \u05dc\u05d1 \u05e9\u05db\u05dc \u05e7\u05d1\u05d5\u05e6\u05ea \u05dc\u05de\u05d9\u05d3\u05d4 \u05ea\u05d4\u05d9\u05d4 \u05d7\u05e9\u05d5\u05e4\u05d4 \u05d0\u05da \u05d5\u05e8\u05e7 \u05dc\u05ea\u05d5\u05db\u05df \u05d4\u05d3\u05d9\u05d5\u05df \u05e9\u05dc\u05d4 - \u05d4\u05d5\u05d3\u05e2\u05d5\u05ea \u05d5\u05ea\u05d2\u05d5\u05d1\u05d5\u05ea.",
    "Use enrollment tracks as the basis for dividing discussions. All learners, regardless of their enrollment track, see the same discussion topics, but within divided topics, only learners who are in the same enrollment track see and respond to each others\u2019 posts.": "S\u1eed d\u1ee5ng c\u00e1c ki\u1ec3u \u0111\u0103ng k\u00fd l\u00e0m c\u01a1 s\u1edf \u0111\u1ec3 ph\u00e2n chia c\u00e1c cu\u1ed9c th\u1ea3o lu\u1eadn. T\u1ea5t c\u1ea3 h\u1ecdc vi\u00ean, b\u1ea5t k\u1ec3 ki\u1ec3u \u0111\u0103ng k\u00fd c\u1ee7a h\u1ecd, xem c\u00e1c ch\u1ee7 \u0111\u1ec1 th\u1ea3o lu\u1eadn gi\u1ed1ng nhau, nh\u01b0ng trong c\u00e1c ch\u1ee7 \u0111\u1ec1 \u0111\u00e3 ph\u00e2n chia, ch\u1ec9 nh\u1eefng h\u1ecdc vi\u00ean trong c\u00f9ng m\u1ed9t ki\u1ec3u \u0111\u0103ng k\u00fd m\u1edbi nh\u00ecn th\u1ea5y v\u00e0 tr\u1ea3 l\u1eddi c\u00e1c b\u00e0i vi\u1ebft c\u1ee7a nhau.",
    "Use my institution/campus credentials": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05d4\u05e8\u05e9\u05d0\u05d5\u05ea \u05de\u05d5\u05e1\u05d3/\u05e7\u05de\u05e4\u05d5\u05e1",
    "Use the All Topics menu to find specific topics.": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05ea\u05e4\u05e8\u05d9\u05d8 '\u05db\u05dc \u05d4\u05e0\u05d5\u05e9\u05d0\u05d9\u05dd' \u05e2\u05dc \u05de\u05e0\u05ea \u05dc\u05de\u05e6\u05d5\u05d0 \u05e0\u05d5\u05e9\u05d0\u05d9\u05dd \u05e1\u05e4\u05e6\u05d9\u05e4\u05d9\u05d9\u05dd.",
    "Use the retake photo button if you are not pleased with your photo": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05dc\u05d7\u05e6\u05df '\u05e6\u05dc\u05dd \u05de\u05d7\u05d3\u05e9' \u05d0\u05dd \u05d0\u05d9\u05e0\u05da \u05de\u05e8\u05d5\u05e6\u05d4 \u05de\u05ea\u05de\u05d5\u05e0\u05ea\u05da",
    "Use your webcam to take a photo of your ID. We will match this photo with the photo of your face and the name on your account.": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05de\u05e6\u05dc\u05de\u05ea \u05d4\u05e8\u05e9\u05ea \u05e9\u05dc\u05da \u05dc\u05e6\u05dc\u05dd \u05d0\u05ea \u05ea\u05de\u05d5\u05e0\u05ea \u05d4\u05ea\u05e2\u05d5\u05d3\u05d4 \u05d4\u05de\u05d6\u05d4\u05d4 \u05e9\u05dc\u05da. \u05d0\u05e0\u05d5 \u05e0\u05ea\u05d0\u05d9\u05dd \u05d0\u05ea \u05d4\u05ea\u05de\u05d5\u05e0\u05d4 \u05d4\u05d6\u05d5 \u05dc\u05ea\u05de\u05d5\u05e0\u05ea \u05e4\u05e0\u05d9\u05da \u05d5\u05dc\u05e9\u05dd \u05d7\u05e9\u05d1\u05d5\u05e0\u05da. ",
    "Use your webcam to take a photo of your face. We will match this photo with the photo on your ID.": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05de\u05e6\u05dc\u05de\u05ea \u05d4\u05e8\u05e9\u05ea \u05e9\u05dc\u05da \u05dc\u05e6\u05dc\u05dd \u05d0\u05ea \u05e4\u05e0\u05d9\u05da. \u05d0\u05e0\u05d7\u05e0\u05d5 \u05e0\u05e9\u05d5\u05d5\u05d4 \u05d0\u05ea \u05d4\u05ea\u05de\u05d5\u05e0\u05d4 \u05dc\u05ea\u05de\u05d5\u05e0\u05ea\u05da \u05d1\u05ea\u05e2\u05d5\u05d3\u05d4 \u05d4\u05de\u05d6\u05d4\u05d4.",
